  apiKey: "AIzaSyC8BNOUwtjHok2M1moVqYHZ9hC1KSivClc",
  authDomain: "jeonghoonkim-d4f87.firebaseapp.com",
  projectId: "jeonghoonkim-d4f87",
  storageBucket: "jeonghoonkim-d4f87.appspot.com",
  messagingSenderId: "351671212657",
  appId: "1:351671212657:web:5e8d777fbbb077612a19d0"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path='/' element={<Main />}/>
          <Route path='/about' element={<About />}/>
          <Route path='/project' element={<Project />}/>
          {/* <Route path='/re' */}
        </Routes>
      </div>
    </BrowserRouter>
  )
}

export default App;
